items.description:
В наличии на складе в Москве сервера (гарантия 1 год) 2U dell poweredge r740 xd нового состояния. Без пыли и царапин на 16 и 24 дисков Sff.

Платформа включает 8 pci-e слотов, куда можно установить диски nvme из наличия от 1,6tb до 6,4tb.

Например, цена на r740 xd 24sff с 2cpu 6154 и 384gb 420 000 руб.

В наличии.

128gb 256gb 512gb 768gb 1tb 196gb.

На выбор в наличии другие процессоры 6146 6246r 6252 6252n или platinum 8280 от 12 до 26 ядер.

В наличии новые серверные диски:

ssdsas3,84-12g Sas 900gb от 9000руб.

R540 r730 xd 12lff нету в наличии. Отличный бу сервер для 1с.

Главное О Нас.

-наличие более 400 серверов на складах в РФ;

-наличие штатных инженеров по HP Dell ibm lenovo серверам;

-интернет магазину на Авито более 150 положительных отзывов;

-наличие 3х летних сервисных контрактов по обслуживанию серверов и схд;

-более 8 лет интернет магазину на Авито;

-от 10 до 20 лет опыт сотрудников на рынке продаж и сервиса ИТ серверов и комплектующих;

