items.description:
Гарантия 1 год. В наличии почти новые 2020 года выпуска сервера 1u формата HP proliant DL360 g10 на 8sff. Безнал с Ндс и без есть.

( вариант, с 2 cpu Gold 6140 или Gold 6138 с 128gb 220 тыс. Руб).

Варианты из наличия для конфигурирования (платформа 120 тыс):

(1) -2 cpu Gold 6146 3.2 ghz 12core(3,2ghz)/.

(2) -2 cpu Gold 6154 3.0 ghz 18core(3,0ghz)/.

(3) -2 cpu Platinum 8260L 2.4 ghz 24core(2,4ghz)/.

(4) -2 cpu Gold 6246R 6248r 3.4 ghz 16core/.

(5) 6252n 6254 6252 6144 6134.

Оперативная память варианты увеличения до 128gb 256Gb (8x32gb) 512gb 768gb 192gb 384gb 1tb 1,5tb и др.

Дополнительно к серверу можно приобрести новые Sas и Ssd диски с гарантией 1год ( более 1200 штук в наличии).

Кратко О Нас.

Наличие 3х летних сервисных контрактов по обслуживанию серверов и схд;

наличие штатных инженеров по HP Dell ibm lenovo серверам;

более 8 лет интернет магазину на Авито;

интернет магазину на Авито более 150 положительных отзывов;

от 10 до 20 лет опыт сотрудников на рынке продаж и сервиса ИТ серверов и комплектующих;

наличие более 400 серверов на складах в РФ;

подберем бу сервер под любые задачи, в том числе vmware, Hyper-V, Rhev, Xen, Kvm, openvz, ovirt, Lxc Dpi (Deep Packet Inspection), Bras, Bgp маршрутизатор, хостинг виртульных машин VM — выделенный сервер (dedicated server), облако (cloud), сервер БД базы данных — сервер 1Cv8 1С 1Cv7 хранилище файлов терминальный сервер Remote Desktop Rdp, биллинг.

